package com.jingfm.api.model;import com.jingfm.api.model.socketmessage.SocketPChatPayloadShareTrackDTO;public class SiteMessageDTO {	private String ctt;	private String ts;	private boolean sf;	private SocketPChatPayloadShareTrackDTO payload;		public String getCtt() {		return ctt;	}	public void setCtt(String ctt) {		this.ctt = ctt;	}	public String getTs() {		return ts;	}	public void setTs(String ts) {		this.ts = ts;	}	public boolean isSf() {		return sf;	}	public void setSf(Boolean sf) {		if(sf == null) return;				this.sf = sf.booleanValue();	}	public SocketPChatPayloadShareTrackDTO getPayload() {		return payload;	}	public void setPayload(SocketPChatPayloadShareTrackDTO payload) {		this.payload = payload;	}	}